import React from 'react';
import Stock from './Stock';
import '../css/portfolio.css';

function Portfolio() {

    const renderOwnedStocks = () => {
        let testing = [];
        for (let i = 0; i < 10; ++i) {
            testing.push(<Stock/>);
        }
        return testing;
    }

    return (
        <header className="portfolioHeader">Portfolio ($5000.00)
            <div className="portfolioContainer">
                <div className="stocksContainer">
                    <div className="stocksList">
                        {renderOwnedStocks()}
                    </div>
                </div>
                <div className="portfolioDivider"></div>
                <div className="purchaseContainer">
                <header id="loginHeader">Sign IN</header>
                <form>

                    <input className="loginField" type="text" placeholder=" email" />
                    <input className="loginField" type="text" placeholder=" password" />
                    <input className="loginButton" type="submit" value="login" />
                </form>
                </div>
            </div>
        </header>
    );
}

export default Portfolio;
